const TiltjsPractice = () => {
  return (
      <div className='container'>
          <h3 className='font-inter font-semibold text-4xl text-black text-center pb-10 animate__animated animate__flipInX animate__slow	1s'>TiltjsPractice </h3>
          <div className='text-center'>
              <button className='bg-sky-400 text-white text-'>tilt</button>
      </div>
      </div>
  )
}

export default TiltjsPractice
